import React from 'react';

const Banner = () => {
  return (
    <div
      className="frame-container"
      style={{
        height: '500px',
        padding: '117px 188px',
        display: 'flex',
        flexDirection: 'column',
        gap: '10px',
        overflow: 'hidden',
        background: 'linear-gradient(90deg, #F23D31 0%, #D23429 100%)',
        position: 'relative',
      }}
    >
      {/* Banner-specific content goes here */}
    </div>
  );
};

export default Banner;
